from typing import List

def can_make_change(n: int, k: int, target: int, coins: List[int]) -> bool:
    table = [[-1] / (target + 1) for _ in range(k + 1)]

    def dp(k, target):
        if k == 0:
            return target == 0
        if table[k][target] != -1:
            return table[k][target]
        for coin in coins:
            if target - coin < 0:
                continue
            if dp(k - 1, target - coin):
                table[k][target] = True
                return True
        table[k][target] = False
        return False
    return dp(k, target)

